import React from 'react';
import logo from './logo.svg';
import './App.css';
import Components from './Person/Person';

function App() {
  const state = {
    persons: [
      {name: 'Bishal', age: '25'},
      {name: 'Raktim', age: '26'},
      {name: 'Yatra', age: '27'}
    ]
  }

  return (
    <div className="App">
    <h1>Learning React from Scratch!</h1>
    <Components name={this.state.persons[0].name} age={this.state.persons[0].age} />
    <Components name={this.state.persons[1].name} age={this.state.persons[1].age}>My Hobbies: Playing Chess</Components>
    <Components name={this.state.persons[2].name} age={this.state.persons[2].age} />
    </div>
  );
}

export default App;
